import React from 'react'
import { useDispatch } from 'react-redux'
import { dataRemove } from './Slice'
import { Link } from 'react-router-dom'
import Button from 'react-bootstrap/Button';
import { useSelector } from 'react-redux';
import Card from 'react-bootstrap/Card';

function Home() {
  const Profile = useSelector(state => state.usData.Pass)
  console.log("Profile",Profile);
  const p=Profile[0]
  const dispatch = useDispatch()
  const lo = () => {
    dispatch(dataRemove())
  }


  return (
    <div >

      <div className='imgsec'>
     <img style={{height:'150px',border:'3px solid black'}} src={`/Images/${p.image}`} alt="" />
      </div>
      <div className='outer'>

<h3>UserName : {p.username}</h3>
<h3>Email : {p.email}</h3>
<h3>Age : {p.age}</h3>
<h3>Address : {p.address}</h3>



      <div>
          <Link to={'/up'} ><Button variant='success'>Update your account</Button></Link>
        </div>
        <div>
          <Button variant="danger" onClick={lo}>Log Out</Button>
        </div>
        <div style={{marginTop:'20px'}}>
          <Link to={'del'} ><Button variant='warning'>Delete your account</Button></Link>
        </div>
      </div>
    </div>
  )
}

export default Home
